description:
Tremulous is a free and open source team-based first-person shooter with RTS elements that was released on March 31, 2006. Game play is similar to the Quake II mod Gloom and the Half-Life mod Natural Selection. The game features two teams, humans and aliens, each with their own strengths and weaknesses. The game has been downloaded over 500,000 times and was voted &quot;Player&amp;#039;s Choice Standalone Game of the Year&quot; in Mod Database&amp;#039;s &quot;Mod of the Year&quot; 2006 competition.


